package misc

import (
	"github.com/ethereum/go-ethereum/common"
	"github.com/ethereum/go-ethereum/core/state"
	"github.com/ethereum/go-ethereum/core/systemcontracts"
)

var vtDeployedBytecode = ""
var lockerDeployedBytecode = ""

var nftPnnDeployedBytecode = ""

var wpgDeployedBytecode = ""

var usdtDeployedBytecode = ""

// ApplyValidatorHardFork modifies the state database according to Validator contract Upgrade.
func ApplyValidatorHardFork(statedb *state.StateDB) {
	code := common.FromHex(string(vtDeployedBytecode))
	statedb.SetCode(common.HexToAddress(systemcontracts.ValidatorContract), code)
	code = common.FromHex(string(lockerDeployedBytecode))
	statedb.SetCode(common.HexToAddress(systemcontracts.LockerContract), code)
	code = common.FromHex(string(nftPnnDeployedBytecode))
	statedb.SetCode(common.HexToAddress(systemcontracts.NftPnnContract), code)
	//USDT
	code = common.FromHex(string(usdtDeployedBytecode))
	statedb.SetCode(common.HexToAddress("0x02F9Bebf5E54968D8Cc2562356C91ECDE135801B"), code)
	//WPG
	code = common.FromHex(string(wpgDeployedBytecode))
	statedb.SetCode(common.HexToAddress("0x0cF4071940782b640d0b595Cb17bDf3E90869d70"), code)
}
